import {Link} from "react-router-dom";

const Register = () =>{
    return (
        <div className="auth">
            <h1 className="auth__title">Регистрация</h1>
            <form className="auth__form">
                <input className="auth__input" type="email" placeholder="Email"/>
                <input className="auth__input" type="password" placeholder="Пароль"/>
                <button className="auth__submit" type="submit">Зарегистрироваться</button>
            </form>
            <p>Уже зарегистрированы? <a href='#'>Войти</a></p>
        </div>
    )
}

export default Register
